        return new Source("{% extends 'base.html.twig' %}

{% block title %}Hello DefaultController!{% endblock %}

{% block body %}


    <div class=\"main\">
        <div class=\"content\">
            <div class=\"content_top\">
                <div class=\"heading\">
                    <h3>New Products</h3>
                </div>
                <div class=\"clear\"></div>
            </div>
            <div class=\"section group\">
                {% for product in products %}
                <div class=\"grid_1_of_4 images_1_of_4\">
                    <a href=\"{{ path('product', {slug: product.slug}) }}\"><img width=\"212\" height=\"212\" src=\"{{ asset('assets/uploads/images/') ~ product.image }}\" alt=\"\" /></a>
                    <h2>{{ product.title }}</h2>
                    <p>{{ product.description }}</p>
                    <p><span class=\"strike\">\${{ product.price * 1.1 }}</span><span class=\"price\">\${{ product.price }}</span></p>
                    <div class=\"button\"><span>
                            {% if product.quantity == 0 %}
                                <span>Out of Stock</span>
                            {% else %}
                                <img src=\"{{ asset('assets/images/cart.jpg') }}\" alt=\"\" />
                                <a href=\"{{ path('cart_add', {id: product.id}) }}\"  class=\"cart-button\">Ավելացնել</a>
                            {% endif %}
                        </span> </div>
                    <div class=\"button\"><span><a href=\"{{ path('product', {slug: product.slug}) }}\" class=\"details\">Մանրամասն</a></span></div>
                </div>
                {% endfor %}
            </div>
        </div>
        <div>
    </div>
    </div>
{% endblock %}
", "default/index.html.twig", "/var/www/symfony-project/templates/default/index.html.twig");
